	public static void test(String filePath, String flight) throws Exception {
		File file = new File(filePath);
		if(!file.exists()) return ;
		
		for(File f : file.listFiles()) {
			System.out.println("文件:" + f.getPath());
			test1(f.getPath(), flight);
		}
	}
	
	public static Set<String> test1(String file, String flight) throws Exception {
		String[] flights = flight.split(";");
		BufferedReader br = new BufferedReader(new InputStreamReader(new FileInputStream(file), "UTF-8"));
		String line = null;
		Set<String> exists = new HashSet<String>();
		while(null != (line = br.readLine())) {
			if(StringUtils.isEmpty(line.trim())) continue ;
			String[] lines = line.split("\t");
			String[] ls = lines[1].split("\\|");
			String depDes = ls[1] + (ls.length >= 3 ? "-" + ls[2] : "");
			if(!"数量[0]".equals(lines[2])) exists.add(depDes);
		}
		
		Set<String> notExists = new HashSet<String>();
		for(String f : flights) {
			if(StringUtils.isEmpty(f)) continue ;
			if(!exists.contains(f)) notExists.add(f);
		}
		System.out.println("航线数据:" + flight + ", 数量:" + flights.length);
		System.out.println("存在航线数据:" + MyStringUtil.spliceValueNotRepeat(exists, ";") + ", 数量:" + exists.size());
		System.out.println("不存在航线数据:" + MyStringUtil.spliceValueNotRepeat(notExists, ";") + ", 数量:" + notExists.size());
		return notExists;
	}
